import React, { Component } from 'react';
import ReactGA from 'react-ga';
import $ from 'jquery';
import './App.css';
import Header from './Components/Header';
import Footer from './Components/Footer';
import About from './Components/About';
import Resume from './Components/Resume';
import Contact from './Components/Contact';
import Testimonials from './Components/Testimonials';
import Portfolio from './Components/Portfolio';
// import mountain2 from './img/mountain2.png'
// import cloud from './img/cloud.png'

class App extends Component {

  constructor(props){
    super(props);
    this.state = {
      foo: 'bar',
      resumeData: {}
    };

    ReactGA.initialize('UA-110570651-1');
    ReactGA.pageview(window.location.pathname);

  }

  getResumeData(){
    $.ajax({
      url:'/resumeData.json',
      dataType:'json',
      cache: false,
      success: function(data){
        this.setState({resumeData: data});
      }.bind(this),
      // error: function(xhr, status, err){
      //   console.log(err);
      //   alert(err);
      // }
    });
  }

  componentDidMount(){
    this.getResumeData();
  }

  render() {
    return (
      <div>
      <meta charSet="utf-8" />
      <title>Felice Png</title>
      <link rel="stylesheet" type="text/css" href="style.css" />
      <link rel="stylesheet" type="text/css" href="https://maxcdn.bootstrapcdn.com/font-awesome/4.7.0/css/font-awesome.min.css" />
      <link href="https://fonts.googleapis.com/css?family=Montserrat|Baloo+Chettan+2|Tangerine&display=swap" rel="stylesheet" />
      <link rel="icon" href="img/logo.png" />
      <header>
        <img className="logo" src="img/logo.png" />
        <nav>
          <ul>
            <li><a className="active" href="index.html">Home</a></li>
            <li><a href="portfolio.html">Portfolio</a></li>
            <li><a href="https://drive.google.com/file/d/1fQvm7qjGCjGkWndiy1mEC6uX420WhLRC/view?usp=sharing">Resume</a></li>
          </ul>
        </nav>
      </header>
      <div className="top-container">
        <div className="Intro">
          <h1>Hi, I'm Felice</h1>
          <p id="p1">an aspiring software developer.</p> 
        </div>
        <div className="bubbles">
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
        </div>
      </div>   



      <footer id="f">
        <img className="flogo" src="img/logo.png" />
        <div className="link">
          <a className="footer-link" href="index.html">Home</a>
          <a className="footer-link" href="portfolio.html">Portfolio</a>
          <a className="footer-link" href="https://drive.google.com/file/d/1fQvm7qjGCjGkWndiy1mEC6uX420WhLRC/view?usp=sharing">Resume</a>
        </div>
        <div className="footer-social-icons">
          <ul>
            <li><a href="https://www.github.com/vikalp2502"><i className="fa fa-github" aria-hidden="true" /></a></li>
            <li><a href="https://www.medium.com/@vikalpkaushik99"><i className="fa fa-medium" aria-hidden="true" /></a></li>
            <li><a href="https://www.linkedin.com/in/vikalp-kaushik-99966a1ab/"><i className="fa fa-linkedin" aria-hidden="true" /></a></li>
            <li><a href="https://www.instagram.com/vikalp._.kaushik/"><i className="fa fa-instagram" aria-hidden="true" /></a></li>
          </ul>
        </div>
        <p className="copyright">Â© 2020 <a href="#" className="f-link">Vikalp Kaushik.</a> All rights reserved.</p> 
      </footer>
    </div>
    );
  }
}

export default App;
